script: |
  super -f tsv -I q3260.sql | sort > q3260.out

vector: true

inputs:
  - name: q3260.sql
    data: |
      SELECT - col2 AS col0 FROM tab2 AS cor0 WHERE - ( + - col1 ) * 54 NOT IN ( + + 31, + col0 * - 49 - 48 + + col2 * + col2 + + + col2 + + - col2 * col2 );
  - name: tab2

outputs:
  - name: q3260.out
    data: |
      -23
      -40
      -58
